import React, {Component} from 'react';
import {Steps} from "antd";

const {Step}=Steps;

class ResetPwd extends Component {
    render() {
        return (
            <div>
                <Steps>
                    <Step title='1'/>
                    <Step title='2'/>
                    <Step title='3'/>
                </Steps>
            </div>
        );
    }
}

export default ResetPwd;
